// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./FundsContract.sol";

contract Parent {
    mapping(address => address) admin_to_index;

    function createFundraiser(string memory creatorName, string memory fundsDescription, uint targetAmount)external returns(address){
        // deploy another smartcontract for this fundraiser
        address fundraiser = address(new Funds(creatorName,fundsDescription,targetAmount));
        admin_to_index[fundraiser] = msg.sender; 
        return fundraiser;
    }

}
